import tkinter as tk
from threading import Thread
import time
import ctypes
import base64
from playsound import playsound

png_file = "image.png"
mp3_file = "sound.mp3"

png_b64 = """"""
mp3_b64 = """"""


with open(png_file, "wb") as f:
    f.write(base64.b64decode(png_b64))

with open(mp3_file, "wb") as f:
    f.write(base64.b64decode(mp3_b64))

def set_volume_max():
    devices = ctypes.windll.winmm.waveOutSetVolume
    devices(0, 0xFFFFFFFF)

def play_sound():
    set_volume_max()
    playsound(mp3_file)

def popup():
    root = tk.Tk()
    root.attributes('-fullscreen', True)
    root.configure(bg="black")

    img = tk.PhotoImage(file=png_file)
    lbl = tk.Label(root, image=img, bg="black")
    lbl.pack(expand=True)

    Thread(target=play_sound, daemon=True).start()
    root.mainloop()

if __name__ == "__main__":
    time.sleep(5)
    popup()
